import React from 'react';
import Header from '../components/Header';
import '../styles/research.css';

class Research extends React.Component{
  render() {
      function w3open() {
        document.getElementById("mySidebar").style.display = "block";
      }

      function w3close() {
        document.getElementById("mySidebar").style.display = "none";
      }
        return (
          <div>
          <Header />

          <div class="w3-sidebar w3-bar-block w3-collapse w3-card" id="mySidebar">
          <button class="w3-bar-item w3-button w3-hide-large"
          onclick={w3close()}>Close &times;</button>
          <a href="1" class="w3-bar-item w3-button">Link 1</a>
          <a href="2" class="w3-bar-item w3-button">Link 2</a>
          <a href="3" class="w3-bar-item w3-button">Link 3</a>
        </div>

          <div class="w3-main">
          <div class="w3-teal">
            <button class="w3-button w3-teal w3-xlarge" onclick="w3_open()">&#9776;</button>
            <div class="w3-container">
              <h1>My Page</h1>
            </div>
            </div>
          </div>

          <div className="divFotosPessoais" >
            <img className="fotoPessoal" alt="Banca" src="https://scontent.fldb1-1.fna.fbcdn.net/v/t1.6435-9/47396769_2580014035342884_3297034024186281984_n.jpg?_nc_cat=109&ccb=1-5&_nc_sid=84a396&_nc_eui2=AeE1LBjnP27plvSgm2RWrHmCFNVyPZypZ7gU1XI9nKlnuBq3SjY-XC8an-b5J9wNEbUTeKG9n54BnK9GTp34DAcM&_nc_ohc=2n-mCk2V91MAX-wNraR&_nc_ht=scontent.fldb1-1.fna&oh=00_AT-cjPg3Wv4ykY14AmRnOUYN36X6_vdoZ3LzBcIn_MzN5A&oe=624402F2"></img>
            <img className="fotoPessoal" alt="Cefet Logo" src="https://www.lavras24horas.com.br/portal/wp-content/uploads/2018/11/1-3-500x330.jpg"></img>
            <img className="fotoPessoal" alt="Fundição" src="https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/275105628_7386658301345076_3567707687195970181_n.jpg?_nc_cat=110&ccb=1-5&_nc_sid=8bfeb9&_nc_eui2=AeHonqog093APKH-68W9xlEX84jo6RzxfMLziOjpHPF8wnvhiU5WBt1GSjfCqQZKxq7V9k2ZEAZwAzuvHrn6JLZA&_nc_ohc=WF_rPq0nPsQAX8jNNRQ&_nc_ht=scontent.fldb1-1.fna&oh=00_AT-L-MMglWwR9Z13N_qzGXl5wptkJqJBbeG8TxEOdcA9KA&oe=6224727D"></img>

            <img className="fotoPessoal" alt="Funed" src="https://scontent.fldb1-1.fna.fbcdn.net/v/t1.6435-9/91402586_3919548094722798_4320823188100481024_n.jpg?_nc_cat=109&ccb=1-5&_nc_sid=84a396&_nc_eui2=AeExN0-6Xo0gVII5wyXXiS6X-dH0qDgiHbb50fSoOCIdtkggdS2nDyKQImXm5zjBacHK8lPTJgUg3b1hq4PPapno&_nc_ohc=FoOeuiNoy2sAX_wQ05k&_nc_ht=scontent.fldb1-1.fna&oh=00_AT9MnPz8ToaCxiMsEsyk117YAiWREPnGEkHV2R-SGiiUag&oe=62447BB5"></img>
            <img className="fotoPessoal" alt="Funed Logo" src="https://ecodiagnostica.com.br/wp-content/uploads/2020/03/funed.png"></img>
            <img className="fotoPessoal" alt="Funed Cultivo garrafas" src="https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/275094712_7386677861343120_884430157110616449_n.jpg?_nc_cat=108&ccb=1-5&_nc_sid=730e14&_nc_eui2=AeGWW8Ht8JGLpwOW-N782_O6nQjzb1LZDeGdCPNvUtkN4SdecXgI-lJApzHl4qO7-T9btg6E2rW7mS6X_uuoLDHR&_nc_ohc=AQcVmoaDCtIAX9kj70G&_nc_ht=scontent.fldb1-1.fna&oh=00_AT99_BbuuljNVtae8HJDcO6-0g1EGOyxNNX112pHPSZhSA&oe=62255624"></img>
          </div>
          </div>
        )
    }
}

export default Research;
